import React from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { Card, Button, Alert } from "react-bootstrap";

const Confirmation = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { booking } = location.state || {};

  if (!booking) {
    return (
      <div>
        <Alert variant="warning">
          No booking information found. Please make a booking first.
        </Alert>
        <Button variant="primary" onClick={() => navigate("/")}>
          Go to Home
        </Button>
      </div>
    );
  }

  return (
    <div>
      <h1 className="text-center mb-4">ðŸŽ‰ Booking Confirmation</h1>

      <Card className="mb-4">
        <Card.Header>
          <h4>Flight Details</h4>
        </Card.Header>
        <Card.Body>
          <div className="row">
            <div className="col-md-6">
              <p>
                <strong>Flight Number:</strong> {booking.flightNumber}
              </p>
              <p>
                <strong>Airline:</strong> {booking.airline}
              </p>
              <p>
                <strong>Departure:</strong> {booking.departure}
              </p>
              <p>
                <strong>Arrival:</strong> {booking.arrival}
              </p>
            </div>
            <div className="col-md-6">
              <p>
                <strong>Departure Time:</strong>{" "}
                {new Date(booking.departureTime).toLocaleString()}
              </p>
              <p>
                <strong>Arrival Time:</strong>{" "}
                {new Date(booking.arrivalTime).toLocaleString()}
              </p>
              <p>
                <strong>Status:</strong>{" "}
                <span className="text-success">{booking.status}</span>
              </p>
              <p>
                <strong>Price:</strong>{" "}
                <span className="text-primary">${booking.price}</span>
              </p>
            </div>
          </div>
        </Card.Body>
      </Card>

      <Card className="mb-4">
        <Card.Header>
          <h4>Passenger Information</h4>
        </Card.Header>
        <Card.Body>
          <p>
            <strong>Name:</strong> {booking.firstName} {booking.lastName}
          </p>
          <p>
            <strong>Email:</strong> {booking.email}
          </p>
          <p>
            <strong>Phone:</strong> {booking.phone}
          </p>
          <p>
            <strong>Address:</strong> {booking.address}
          </p>
        </Card.Body>
      </Card>

      <div className="text-center">
        <Alert variant="success">
          <h5>Your booking has been confirmed!</h5>
          <p>You will receive a confirmation email shortly.</p>
        </Alert>

        <Button
          variant="primary"
          onClick={() => navigate("/")}
          className="me-2"
        >
          Book Another Flight
        </Button>
        <Button
          variant="outline-secondary"
          onClick={() => navigate("/profile")}
        >
          View Profile
        </Button>
      </div>
    </div>
  );
};

export default Confirmation;
